BEGIN;
INSERT INTO `business` VALUES ('1', '1', '4', '', '3', 'Autoport', '', 'Bars & Restaurants', '1', 'www.theautoport.com/index.php', '', '', '', '', '2009-07-09 00:00:00', null, 'Dating back to 1936, The Autoport is one of State College\\\'s best known landmarks.  It has been a site for lodging, coffee, and dining for more than seven decades.  Today, the present owners Greg and Lynda Mussi and Kathy Punt are restoring the Autoport back to the beginning by opening up the original canopy at the main entrance (where the Cadillac room once stood) and plans are currently underway to re-install the old garage doors near the coffee shop and provide additional outdoor seating. The bar and dining room have also been renovated to create a unique urban upscale ambiance that is sure to please its guests.  The Autoport offers so much:  a restaurant, bar, and hotel, located on business 322/South Atherton Street.  The Autoport is close to Beaver Stadium, the Bryce Jordan Center, and downtown State College.', '', '0', '47', '0'), ('7', '1', '48', '', '40', 'The Gingerbread Man', '', 'Bars & Restaurants', '9', 'http://www.gmanstatecollege.com', '', '', '', '', '2009-08-12 00:00:00', null, 'The G-Man is one of downtown State College\\\'s all-time restaurant landmarks!  Under NEW OWNERSHIP, the G-Man just celebrated its 25th anniversary.  The new and improved atmosphere includes a larger outside seating area, 25 brand new TV\\\'s, and an expanded take-out beer selection.  The new owners of the G-Man are innovative marketers and they truly understand their local customers.  The G-Man is promoting its top quality food menu and is encouraging lunch time and dinner dining for local residents - truly making the G-Man a great restaurant and a great bar.\r\n\r\nAs always, the G-Man will also appeal to the nighttime crowd with excellent, live music, drink specials, and a new late-night menu.  For more information, visit the G-Man website at www.gmanstatecollege.com.', '', '0', '25', '0'), ('8', '1', '50', '', '41', 'Douglas Albert Gallery - Quality Art on McAllister Alley', '', 'Services', '6', 'http://www.douglasalbertgallery.com', '', '', '', '', '2009-08-17 00:00:00', null, '107 McAllister Alley Walkway, State College, PA 16801 -- Since 1981, Douglas Albert Gallery has been finding and sharing quality art with discerning clients looking for original and beautiful pieces. Browse among a vast inventory of quality paintings, sculpture, glass work, photography, ceramics and genuine African art. With 30 years of experience, Douglas Albert is able to help first-time purchasers find some beautiful new adornments for the home and assist the seasoned collector in making astute acquisitions of fine works.', '', '0', '8', '0'), ('9', '1', '52', '', '42', 'Uncle Eli\\\'s', '', 'Other', '5', 'http://www.uncleelis.wordpress.com', 'http://www.facebook.com/pages/State-College-PA/Uncle-Elis-Artist-Marketplace/270439875196?ref=ts', '', '', '', '2009-08-17 00:00:00', null, 'Uncle Eli\\\'s is your town\\\'s artist marketplace & gift emporium!  We are downtown State College\\\'s source for art supplies, custom framing materials, greeting cards and gifts.\n\nWe are conveniently located one block from the Penn State University Park Campus. Look for us on Beaver Ave. near the intersection with Pugh St.\n\nStop in for a paintbrush or bendable party mustache!  And while viewing our Cogster profile, click below on our website link and bookmark us.  That way, you can check back for weekly specials and new arrivals!', '', '0', '26', '0'), ('10', '1', '56', '', '45', 'Stefanie Kyle Design & Knowledge', '', 'Services', '89', 'http://www.stefaniekyle.com', 'http://www.facebook.com/home.php?#/pages/Stefanie-Kyle-Design-Knowledge/113069311308', 'http://twitter.com/stefaniekyledk', '', '', '2009-09-04 00:00:00', null, 'Stefanie Kyle Design & Knowledge is a web design and computer learning center, located in the Surface Artist Cooperative.  We offer website design and development services to businesses, individuals, and organizations.  In addition, we offer workshops on a variety of computer-related topics.  These workshops are perfect for professionals, or anyone just wanting to add to their computer skills.', '', '0', '13', '0'), ('11', '1', '61', '', '49', 'A Caring Touch: Massage Therapy', '', 'Health and Fitness', '34', 'http://www.acaringtouch.massagetherapy.com', 'http://www.facebook.com/home.php#/pages/State-College-PA/A-Caring-Touch-Massage-Therapy/75194327411', '', '', '', '2009-09-06 00:00:00', null, '\\\"Taking Away Your Aches And Pains\\\", and \\\"Helping Moms, Helping Babies\\\", A \nCaring Touch: Massage Therapy has been providing Massage Therapy Services since 2003. During that time, our therapy has helped people relieve the pain of injuries, stress, car accidents, and body discomfort, as well as maintain good bodily and mental health. \n\nMore recently, we have expanded our services to include Advanced Certification and Specialization in Prenatal Massage, and offering Infant Massage Classes to parents who want to provide their babies the benefits of massage therapy.\n\nWe offer many different forms of Massage to meet the many different needs of every person. From advanced specialization in Pregnancy and Infant Massage, to Therapeutic massage techniques such as Deep Tissue and Trigger Point Therapy, to more relaxing techniques such as Swedish and Hot Stone Massage, and finally specialized therapeutic needs such as Sports and Fibromyalgia Massage, there is a form of massage therapy available for everyone\\\'s needs. \n\nSo welcome again and we hope to be able to help you with all of your massage therapy needs!', '', '0', '10', '0'), ('12', '1', '67', '', '54', 'Mary Kay Cosmetics', '', 'Health and Fitness', '67', 'http://www.marykay.com/cwalsh', '', '', '', '', '2009-09-08 00:00:00', null, 'Celebrating 30 years serving my Mary Kay customers and training consultants.  I carry a full inventory of all the Mary Kay Cosmetics line.  We offer age fighting skin care, body care, glamour, fragrance and spa products along with a men\\\'s product line and skin care for teens.  Our newest products include a replenishing serum and mineral powder foundation, shadows, highlighters, bronzers and blushers  with a refillable case, and the newest tinted lip balms.', '', '0', '10', '0'), ('15', '1', '84', '', '68', 'Contempo Jewelry', '', 'Other', '38', 'http://www.contempojewelry.net', 'http://www.facebook.com/home.php#/pages/Contempo-Jewels', 'http://twitter/contempojewels', '', '', '2009-09-12 00:00:00', null, 'All Contempo Jewelry pieces are designed & hand created by me, Staci Egan.\n\nI am inspired through life. My moods and surroundings directly affect my work. My pieces are very natural and organic. I like to keep my work fresh. I love mixing colors you may not commonly see together.\n\nI have been a jewelry artist for close to 10 years, my background includes a mix of workshops and self-taught methods. Besides selling online, I sell in local boutiques, galleries, stores, and art and craft shows. I have been featured on Wig Jig, State College Magazine, byhand.me, Nittany Weddings, Found Handmade, Wickedly Chic, Centre Daily Times, Local Bounty, Living my MoMent, Homegrown in Happy Valley & Indie Parade. I am also a member of the Art Alliance, the Central Pennsylvania Guild of Craftsmen, and a committee member for the Gallery Shop in Lemont. I enjoy displaying my work and meeting new people. I am always open to make custom pieces upon request. I specialize in Bridal pieces.\n\nI love having my own business. I spent most of my life settling and letting life have control of me. Now I control my life. I feel so lucky to have a supportive family and I love what I do. It is an honor when someone chooses me to create a special piece for them. I get to meet many fantastic people and give back to my community. It doesn’t get much better than that.', '', '0', '13', '0'), ('16', '1', '88', '', '71', 'EveryDay Angels', '', 'Other', '35', 'http://hurbanski.etsy.com', 'http://www.facebook.com/pages/EveryDay-Angels/101340281083?ref=nf', 'http://twitter.com/hurbanski', '', '', '2009-09-12 00:00:00', null, 'Stained Glass Angels, Jewelry, and Art.\nMy suncatchers have soul, and my jewelry can be as unique and interesting as you are.  \nI welcome custom orders and look forward to working with you to make your ideas come true. \nAdorn your home, adorn yourself, adorn your life.', '', '0', '10', '0'), ('19', '1', '109', '', '89', 'Zola Bistro:  2010 Original Project', '', 'Bars & Restaurants', '17', '', '', '', '', '', '2009-09-23 00:00:00', null, 'One of downtown State College\\\'s most innovative, contemporary locations for fine cuisine.', '', '0', '43', '0'), ('20', '1', '111', '', '90', 'Gamble Mill Restaurant and Micro-Brewery', '', 'Bars & Restaurants', '18', 'http://www.gamblemill.com', 'http://www.facebook.com/home.php?#!/pages/Bellefonte-PA/The-Gamble-Mill/127480617303193', '', '', '', '2009-09-23 00:00:00', null, '160 Dunlap St., Bellefonte, PA 16823 -- Delicious and reasonably priced cuisine. Check out some excellent locally-crafted beers at the Microbrewery. ‘We use quality local products to craft a truly unique dining experience.’', 'Our cuisine entrees are served in a relaxed and welcoming setting that you and your friends and family are sure to enjoy. Whether you are in the mood to indulge in something new or just want to enjoy some old favorites, we promise that our inventive menu and attentive service will leave you truly satisfied. No matter what your occasion calls for or your appetite demands, the friendly staff at Gamble Mill promise to make your next dining experience a pleasant one. \n\nWe Are Best Known For...Quality of food, Extensive Wine List, Impeccable Service, and Ambiance', '1', '53', '0'), ('23', '1', '118', '', '94', 'The Hutchinson System of Integrated Mind Body Therapies', '', 'Health and Fitness', '37', 'http://www.hutchinsonsystem.org', 'http://www.facebook.com/pages/The-Hutchinson-System-Integrated-Massage-and-Bodywork-Therapies/36215877244', 'http://twitter.com/HSMassage', '', '', '2009-10-08 00:00:00', null, 'The Hutchinson System of Integrated Mind Body therapies opened its doors in 1997 as a way to offering and linking training and therapeutic services of Massage, Traditional Fitness, Healing, and Meditation Systems, and Martial Arts Conditioning. \r\nSince that time it has served the Central Pa area by offering original programming for health, fitness, and educational facilities throughout the area, maintaining the goals of providing the highest quality services in a way affordable to all. \r\nEver evolving, The Hutchinson System of IMBT offers Thai Yoga Massage, Reflexology and Acupressure, Multiple Systems of Reiki Natural Healing and External Qigong, Deep Tissue Massage, and Sports Conditioning among its services. \r\nThe Signature Massage Style of the Hutchinson System of IMBT is an Integrative Bodywork system designed to enhance body’s soft tissue healing properties, help reduce scar tissue, and improve flexibility to reduce and relieve pain and muscle tension from stress and old injuries.  \r\nSelf-care is taught through the movement arts branch of The Hutchinson System of IMBT. TaiChiTeacher.Org offers original comprehensive programming in a number of movement, meditation, and martial arts in public classes at its partner facilities. Private training is also available.', 'Bruce Hutchinson holds a Bachelors of Psychology from the Pennsylvania State University, a certification as a Massage Therapist and Chiropractic Assistant from the Central Pennsylvania School of Massage.  A Master in the Usui Reiki, Kundalini Reiki, and the Egyptian Sekham Systems of Natural Healing and classically trained Reflexologist, he has been a Tai Chi Player since 1991.  \r\nA life-long student of meditation, yoga, martial arts, and natural healing He continues to explore the nature and limits of the human body and mind daily.', '0', '7', '0'), ('25', '1', '169', '', '143', 'Downtown State College Improvement District', '', 'Non-Profit', '21', 'http://www.downtownstatecollege.com', '', '', '', '', '2009-12-01 00:00:00', null, 'State College, PA, is one of the best places on the planet to live, learn, work, and relax.\r\n\r\nThe Downtown Improvement District is an organization designed to facilitate State College\\\'s vitality by pooling resources and uniting attributes.  We provide outreach in support of merchants, residents, and shoppers.\r\n\r\nOur vibrant downtown lies at the heart of the town-and-gown community.  \r\n\r\nNo matter what you need, want, or enjoy — you can find it downtown.  And, the Downtown Improvement District can help direct you to your needs.\r\n\r\nClick below to visit our website and check out the over 250 businesses who make up our downtown merchant member list.  Access maps and event calendars!\r\n\r\nHave a great time and enjoy Downtown State College!', '', '0', '19', '0'), ('26', '1', '175', '', '148', 'Harper\\\'s Shop for Men', 'M, T, W, F, Sa  9-6\nTh  9-8\nSu 12-4', 'Services', '22', 'http://www.harpersshopformen.com', 'http://www.facebook.com/pages/State-College-PA/Harpers-Shop-For-Men/316195995025', '', 'http://www.youtube.com/watch?v=_vv48kdjUeQ', 'http://www.youtube.com/watch?v=YGdpRf51anE', '2009-12-03 00:00:00', null, 'Harper\\\'s offers exclusive men\\\'s clothing lines that include:\nTommy Bahama, Bill\\\'s Khakis, Calvin Klein, Vinyard Vines, Talia, Mountain Khakis, JackVictor and many more. \n\nWe are located downtown on West College Avenue, just around the corner from the Corner Room.\n\nOver eighty years ago, Harper\\\'s opened its doors with a relentless commitment to providing our customers with the best of the best. Today, in our third generation, we are regarded as one of the area\\\'s great clothing stores. Part of our commitment also includes a policy of extraordinary customer service.  Free custom alterations by our European tailors and fashion coordinators are part of our ripe tradition. In essence, at Harper\\\'s we believe in treating our customers as individuals. That\\\'s not typical, but neither is Harpers. \n\nIn this age of mall culture and mass merchandising, every store starts to look the same. At Harper\\\'s, instead of mass merchandise, we offer exclusive merchandise. Every single item and designer line is handselected by a team of professionals who search the markets worldwide.', '', '0', '12', '0'), ('28', '1', '182', '', '153', 'Jezebel\\\'s Boutique', '', 'Other', '24', 'jezebelslingerie.com/', '', '', '', '', '2009-12-10 00:00:00', null, 'We are downtown State College\\\'s preferred lingerie boutique, specializing in bras, panties, maternity wear, bath & body products, cosmetics, handbags, and many more accessories.  \n\nAt Jezebel\\\'s, we also offer professional bra-fitting!  Jezebel\\\'s carries over 23 brands of bras including Wacoal, Panache, Spanx, Chantelle, Cosabella, Natori, Betsey Johnson, Fayreform and more.\n\nClick on our website in order to read exciting testimonials and an article about how a professional bra fitting can change your life.\n\nParking is available on the street\n(or) in the lot on S. Garner Street\nbehind the building.', '', '0', '19', '0'), ('29', '1', '184', '', '154', 'Gemelli Bakers', '', 'Bars & Restaurants', '25', 'http://www.cakeandcommerce.com/cake_and_commerce/2009/01/gemelli-bakers-going-slow-in-state-college-pa.html', '', '', '', '', '2009-12-13 00:00:00', null, '129 S. Pugh Street (enter from McAllister alley), State College, PA 16801 -- Gemelli\\\'s offers first class baking from the hearth of downtown State College, PA.', '', '1', '62', '1'), ('33', '1', '207', '', '173', 'Mandy Sergent, Yoga Therapist, Instructor, Studio Owner', '', 'Health and Fitness', '44', 'http://www.mandysergent.com', 'http://www.facebook.com/pages/State-College-PA/Mandy-Sergent-Yoga-Instructor-Therapist-and-Studio-Owner/229251214072?ref=mf', '', '', '', '2010-01-15 00:00:00', null, 'Mandy teaches gentle, flowing Kripalu style yoga classes, and prenatal yoga classes. She also offers Phoenix Rising Yoga Therapy sessions and is a Holistic Health Counselor.  If you are looking for a yoga class where you can work at your own pace, gain strength, increase flexibility, and reduce stress, without feeling like you need to keep up with the person next to you or look exactly like the instructor, then these classes are right for you!  Mandy understands that no two bodies are exactly alike, so she gently guides students to feel their way into poses, doing what complements their body, rather than aiming to look picture perfect. \n\nIf you want to take your practice to an all new level of healing, try Phoenix Rising Yoga Therapy. A Phoenix Rising Yoga Therapy session is a one-on-one process lasting one-and-a-half hours that encourages a deeper connection with self. As the practitioner, Mandy will lead you through guided meditations, breath work, assisted yoga postures and movement while you maintain an inward focus. Mandy uses non-directive dialog to bring your attention to what is happening in the present moment and reflects your observations back to you, while witnessing you without direction or judgment. This process can foster insight into long-held patterns, emotional release, relaxation, and healing.  Phoenix Rising Yoga Therapy is a simple, yet powerful process, that offers you an opportunity to connect to this deep innate wisdom and align with your heart\\\'s desires.', '', '0', '20', '0'), ('35', '1', '275', '', '239', 'ADS Solutions- Your Garage Storage Solution', '', 'Services', '46', 'http://www.gorgeousgarage.com/', 'darren@ADSsolutions.biz', '', '', '', '2010-01-31 00:00:00', null, 'We can make your garage look this good, and even better.  ADS Solutions is a new locally-owned business in the Centre Region.  We focus on helping you gain back control of your garage!  Discover how good it feels to have all your tools and toys conveniently organized and stored for easy access.   Tired of side-stepping boxes and gear to get to your car?  Call ADS today for a FREE ESTIMATE on how to eliminate the chaos of clutter and make your garage one of the best rooms in your house.  For video and photos of this innovative and affordable storage system, please click here:  http://gorgeousgarage.com/Products/Videos/ \nVideo-Display/?id=1\n\n(Note:  ADS is Central PA\\\'s official dealer and installer of the Monkey Bar Garage System, created by Gorgeous Garage Company)\n\nAdditionally, ADS offers expertise in Custom Remodeling and Renovation solutions for your Home.  Please contact Darren Spotts at 814-308-5228, or by email at:  darren@adssolutions.biz   ADS Solutions.  Build it. Live it.', 'Darren Spotts is a seasoned Real Estate Developer and Residential Construction Manager with more than 15 years of experience.  He has successfully managed both large and small residential projects.  In addition, Darren\\\'s experience includes 8 years with one of the biggest construction firms in Central Pennsylvania.  His core skill is delivering quality solutions and top customer service.  \n\nDarren founded ADS Solutions, Inc. in 2010.  He is a PA-Certified Real Estate Agent and performs remodeling consultation and renovation contracting services.  Most recently, Darren obtained certification to serve as exclusive Central PA dealer of the innovative Monkey Bar Garage System, by Gorgeous Garage.  He came across this efficient garage storage solution as he was researching a way to assist one of his clients during a renovation project.  And, at that moment, Darren began to strategize a plan to deliver this neat, new Monkey Bar product to customers in Central Pennsylvania.  \n\nThe motto at ADS is Build It.  Live It.  This is because your home is such an important asset in your life.  Darren\\\'s mission is to help you make your home just a little bit better.  And, perhaps your garage is the best place to start...\n\nDarren grew up in the Bald Eagle Valley, where he currently lives with his wife, Autumn, and their two daughters.', '0', '12', '0'), ('36', '1', '293', '', '256', 'Loaded Creative LLC', '', 'Services', '70', 'http://www.weareloaded.com', '', '', '', '', '2010-02-15 00:00:00', null, 'An award winning, strategic creative consultancy and marketing communications company that custom-builds highly-skilled communications teams specific to each particular job, series of jobs, or full-service campaigns.\n\nWe specialize in Advertising, Design, Interactive, Branding, Creative Strategy & Marketing Consulting.', '', '0', '7', '0'), ('38', '1', '302', '', '263', 'The Inn at Edgewater Acres', '', 'Other', '80', 'http://www.edgewateracres.net', 'http://www.facebook.com/#!/pages/Alexandria-PA/Inn-at-Edgewater-Acres/248415366541?ref=ts&__a=7&ajaxpipe=1', '', '', '', '2010-02-22 00:00:00', null, 'The Inn at Edgewater Acres is a picturesque destination in the South Central Mountains of Pennsylvania located in Huntingdon County on the Juniata River. Our main lodge was built in 1762 with ties to William Penn. As you arrive, driving down our lane lined with trees, you just begin to relax!\n\nThis is the perfect setting for weddings, reunions, corporate events, retreats or special gatherings.', '20 room inn each with its own private bath.  On site upscale and casual dining, with nice wine list. Large indoor and outdoor areas for gatherings.', '0', '9', '0'), ('40', '1', '307', '', '266', 'Goodco Mechanical, Inc', '', 'Services', '41', 'www.goodcoinc.com', '', '', '', '', '2010-02-23 00:00:00', null, 'Goodco Mechanical specializes in commercial and residential HVAC and plumbing service and installation with special emphasis on geothermal heat pump systems.', 'Our company started in April of 2008 and have become one of the fastest growing mechanical contractors in the Centre Region. Our focus on customer service has helped Goodco develop an ever-increasing list of satisfied customers. We price by the job and not by the hour so you know the price before we start the work. We\\\'re the Good Guys!', '0', '8', '0'), ('42', '1', '312', '', '269', 'The Water Street Grill', 'Monday     Closed    Sat  9-2   4-10\r\nTues.      Closed    Sun  9-2   4-9\r\nWed    4 to 9       \r\nThurs  4 to 9\r\nFri    4 to 10', 'Bars & Restaurants', '45', 'www.thewaterstreetgrill.com', 'The Water Street Grill', '', '', '', '2010-02-24 00:00:00', null, 'Simple food prepared well. Plus great pricing. From homemade subs and pizzas to great steaks.  You Save 50% of your bill just by us being BYOB.  As long as people are coming in we stay open.', 'I restored the old original bank of Spring Mills hoping to bring some variety to this area.  You can even reserve the Vault for private dining (seats 8).', '0', '23', '0'), ('45', '1', '327', '', '281', 'Titan Fitness and Martial Arts', 'Monday through Thursday 5 am - 12 am\nFriday  5 am - 10 pm\nSaturday and Sunday 8 am - 6 pm', 'Health and Fitness', '48', 'www.titanfitness.com', 'http://www.facebook.com/TitanFitness?ref=ts', 'http://twitter.com/TitanElitePaul', '', '', '2010-03-10 00:00:00', null, 'Titan Fitness and Martial Arts is Central PA\\\'s only full-time, full service martial arts, boxing, and fitness facility.  We offer classes in mixed martial arts, Brazilian Jiu-Jitsu, Thai boxing, women\\\'s kickboxing, Filipino martial arts, and youth martial arts programs.  We also offer personal and small group fitness, martial arts, and boxing lessons. We are conveniently located in downtown State College within walking distance to local residents and Penn State students.', '', '0', '12', '0'), ('55', '1', '366', '', '310', 'Lotus Center Yoga', 'Coming soon!', 'Health and Fitness', '55', 'www.lotuscenteryoga.com', '', '', '', '', '2010-04-23 00:00:00', null, 'Lotus Center Yoga offers a wide range of styles and approaches to yoga. Check the website for our full schedule of classes, as well as workshops and special events. We are also the home of The Enchanted Kitchen, a fresh whole foods cafe and juice bar.', '', '0', '13', '0'), ('58', '1', '396', '', '336', 'Saint\\\'s Cafe', '', 'Bars & Restaurants', '58', 'http://www.statecollegecoffeeshop.com/', 'http://www.facebook.com/pages/State-College-PA/Saints-Cafe/24825957797?ref=ts', '', '', '', '2010-05-18 00:00:00', null, 'Owned by a local family, Saint\\\'s Cafe is a European-style coffee shop that offers State College the highest-quality direct trade coffee in the area.\nWe also provide fine teas and enticing baked goods from local bakers.\nWhen you\\\'re ready for your daily treat, why not support a locally-owned, independent coffee shop?  Almost 75% of every dollar spent at a locally-owned business stays locally. Compare this to less than 40% of every dollar spent at a national chain coffee shop staying in our town.  These local dollars help support local accountants, bakers, media outlets, designers and more.\n\nSo please stop on by - our baristas lovingly prepare each cup of coffee by hand every step of the way, doing everything in their power to ensure that when you sit down with a cup of Saint\\\'s coffee — you are drinking the best..., and helping sustain your Main Street.', 'Welcome to Saint\\\'s Cafe, established in downtown State College, PA in 1999. Our gourmet coffeehouse is known to “lift your spirits” with exceptional drinks and enticing locally-baked goods.\nCreated in the style of traditional European Cafes, Saint\\\'s Cafe is inspired by travels throughout the world. We\\\'re continuously searching for new ideas and love to share enjoyable new products with our friends in Happy Valley.', '0', '31', '0'), ('62', '1', '477', '', '413', 'Pennsylvania Association for Sustainable Agriculture (PASA)', '', 'Clubs and Non-Profits', '62', 'http://www.pasafarming.org', '', '', '', '', '2010-06-01 00:00:00', null, 'Serving the Community of Sustainable Farmers, Consumers and Businesses Throughout Pennsylvania and Beyond.\n\nOur Mission: Promoting profitable farms which produce healthy food for all people while respecting the natural environment.', 'PASA is an organization as diverse as the Pennsylvania landscape.  We are seasoned farmers who know that sustainability is not only a concept, but a way of life.  We are new farmers looking for the fulfillment of land stewardship.  We are students and other consumers, anxious to understand our food systems and the choices that must be made.  We are families and children, who hold the future of farming in our hands.  This is an organization that is growing in its voice on behalf of farmers in PA and beyond.  Our mission is achieved, one voice, one farm, one strengthened community at a time.', '0', '32', '0'), ('67', '1', '693', '', '622', 'Shear Spirit', '', 'Services', '68', 'www.shearspirit.net', 'http://www.facebook.com/pages/Bellefonte-PA/Shear-Spirit/156595469594', '', '', '', '2010-06-22 00:00:00', null, 'We are your complete modern day Hair Salon with old time Beauty Salon service!  Featuring certified organic products by All Nutrient and a kid play area for moms needing a safe place for the kids to go while she gets the hair care she deserves. Stop in and check us out for yourself at 136 W. High St. in beautiful downtown Bellefonte, Pennsylvania! You can also call 814-355-7778 to schedule an appointment or just to find out more!  Email:  shearspirit@yahoo.com', 'Barbara Rossman writes:  I have been a hair stylist for over twenty years. I\\\'ve always wanted to own my own salon. Last year, I started looking seriously into that venture. I found the perfect location in the heart of Bellefonte. It is still close enough to State College and is easy for anyone in the Centre Region to get to.  I am joined by my daughter, Eva Higgins, who helps me out with all the day to day tasks of running a locally-owned business.', '0', '9', '0'), ('68', '1', '699', '', '627', 'Bonfatto\\\'s Restaurant & Lounge', 'Sunday - Wednesday, 11 a.m. – 10 p.m.\nThursday - Saturday, 11 a.m. - 11 p.m', 'Bars & Restaurants', '75', 'http://www.bonfattos.net/', 'http://www.facebook.com/home.php?#!/pages/Bonfattos-Retaurant-and-Lounge/108282329828?ref=ts', '', '', '', '2010-06-23 00:00:00', null, 'Bonfatto\\\'s is an icon that has been in business since 1919, but we have a lifetime of experience. We are the go-to restaurant for a great dining experience and our delicious menu items—like our trademarked  Bonanza™ Sub—and our wonderful atmosphere set us apart.', 'Guy opened a confectionary and grocery store in South Renovo Circa 1912.  He closed in 1917 to serve in the U.S. Army during WWI.  Upon his completion of duty, Guy and Pauline opened a grocery and produce store on August 15, 1919 in the Bush Arcade in downtown Bellefonte.  In addition to the retail and wholesale goods offered at the store, Guy also delivered produce to residences.  This began the tradition of quality products and service still known today!', '0', '24', '0'), ('72', '1', '719', '', '643', '1 North Front Street Cafe Books Events', 'Mon & Wed 11 a.m. to 5 p.m.\nTues 5 to 8 p.m.\nFri 11 a.m. to 8 p.m.\nSat 10 a.m. to 3 p.m.\nSun 11 a.m. to 3 p.m.', 'Other', '73', 'http://www.1northfrontstreet.com', 'http://www.facebook.com/pages/Philipsburg-PA/1-North-Front-Street-Cafe-Books-Events/104482953971?v=wall#!/pages/Philipsburg-PA/1-North-Front-Street-Cafe-Books-Events/104482953971?v=info&ajaxpipe=1&__a=3', '', '', '', '2010-06-30 00:00:00', null, 'We feature Fair Trade & organic coffee and teas, gluten-free baked goods and desserts, thousands of used books, and FREE wireless internet access!', '1 North Front Street Cafe Books Events opened in February 2010. It is a cafe bookstore that has second floor space available for meetings and events.  You may even talk owner Kristine into using the first floor for your event. Event coordination and catering at other locations is also available.', '0', '16', '0'), ('74', '1', '731', null, '653', 'Blackhawk Homestead Nursery', null, 'Services', '0', null, null, null, '', '', '2010-07-08 00:00:00', null, null, null, '0', '0', '0'), ('77', '1', '762', '', '679', 'Parks Pest Control', '', 'Services', '96', 'http://www.parkspestcontrol.com/', '', '', '', '', '2010-07-14 00:00:00', null, 'We offer a full line of pest control services - whether you are a commercial business or a homeowner, we are happy to assist you.\n\nParks Pest Control, LLC can help you solve your:  Rodent problems, pest problems carpenter ant problems, fly problems, bedbug problems and more...\nWe can provide you with real estate pest inspection, and we offer same day service for your emergency pest control needs. No long term contracts are required.\n\nWe are fully insured and locally owned and operated.', 'Do you have problems with unwanted pests?\nAre you looking for service from someone who can give you a straight answer?\n\nParks Pest Control, LLC gives you professional, affordable, and reliable service from a locally owned and operated company. Serving Centre and Clinton counties, the experienced father and son team of John and Jacob Parks can solve your pest-related problems. We use natural pest control products that are safe for your family, pets and the environment.  Whether your needs are commercial or residential, we can work with you. We always put our customers\\\' needs first.', '0', '13', '0'), ('78', '1', '769', '', '685', 'Webster\\\'s Bookstore Cafe', 'Sugar on Top location:  7am to 9pm, Monday to Friday\n8am to 9pm, Saturday', 'Bars & Restaurants', '81', 'http://www.webstersbookstorecafe.com/', 'http://www.facebook.com/home.php?#!/group.php?gid=136097703081733&ref=ts', '', '', '', '2010-07-14 00:00:00', null, 'We’re now serving coffee downtown at Sugar On Top!  7am to 9pm, Monday thru Friday (8a to 9p, Sat).  Sugar On Top is a Cupcake Boutique at 121 1/2 East Beaver Ave. in the alley behind Rita’s.  In addition, please visit our 434 W. Aaron Drive location to enjoy organic food and coffee.  And if you are looking for books, stop by our temporary location in the Fraser Street Plaza, at 121 S. Fraser Street. \n\nIf you join our Cogster Loyalty Campaign, you can redeem your Cogster Rewards Cash at any of these locations.  And soon, we’ll be moving into our new, permanent location!', 'Webster\\\'s is your definition of Local - after 11 years on Allen Street, we have opened a temporary location at 121 S. Fraser Street in the Fraser Street Plaza next to the parking garage and are currently working on plans for a long-term home in the downtown.  At the moment, we are operating our cafe in the same location as Sugar On Top Cupcake Boutique, 121 ½ East Beaver Avenue.  In addition, our Aaron Drive location is open at 434 W. Aaron Drive.\n\nPlease stay tuned to our website for location updates. \n\nFor all of you who have been a part of Webster\\\'s past and present, please keep believing the future. It\\\'s going to be bigger and better, I promise you!\n\nIn the meantime, visit Sugar On Top or the Aaron Drive location to enjoy the fair-trade, organic coffees you\\\'ve come to love as well as the quality local foods you expect. Webster\\\'s is still catering, as well, so please call or email for details if you need delicious, organic food for your next event.\n\nAnd if you are looking for books, stop by the location in the Fraser Street Plaza, downtown State College. \n\nOur History:  Webster\\\'s Bookstore Café is a general used bookstore stocking over 100,000 titles in our inventory, with large holdings in fiction and literature, history, literary criticism, science fiction and fantasy, and vintage paperbacks. We offer a full line of coffee and espresso drinks, teas, and delicious desserts. Our café serves shade-grown, organic Fair Trade coffees, Metropolitan teas and Sweet Indulgence desserts. We deal with local vendors whenever possible, but look for similar standards of environmental and community concern in choosing our other vendors, as well. Webster\\\'s is the proud inheritor of a long line of State College used bookshops. Founded in 1974 as Book Swap on Fraser Street, we became Seven Mountains Books in 1993 on Pugh Street. Webster\\\'s moved to Allen Street in June of 1999, adding the café and doubling the size of the bookstore. The store was renamed Webster\\\'s Bookstore Café at that time.  And now, we’re beginning a new chapter.  Thank you one and all for your concern and your support!', '0', '135', '0'), ('84', '1', '918', '', '827', 'Katey\\\'s Corner', '', '', '95', '', 'www.facebook.com/KateysCorner', 'KateysCorner', '', '', '2010-07-19 00:00:00', null, 'Katey\\\'s Corner offers reasonably priced gift items, home decor, and engravables (pet tags, ID tags, etc.) for you and your loved ones.  We also offer personalized novelty license plates and car magnets to enhance your individuality! Katey\\\'s Corner offers layaway options.  Talk to us about fundraising opportunities for qualified organizations and events.  We\\\'re here for you!!', '', '0', '5', '0'), ('85', '1', '929', '', '837', 'Green Irene', 'Business Hours are only an email or phone call away! charlene.statecollege@greenirene.com', 'Services', '85', 'http://www.GreenIrene.com/1427', 'http://www.facebook.com/pages/Cha-Chas-Green-Corner/148934611795712', 'http://www.twitter.com/chacha58', '', '', '2010-07-20 00:00:00', null, 'Green Irene started because saving energy, water and money all make sense.  Having a healthier home with fewer toxic chemicals and better indoor air quality is a no-brainer.  Green Irene is on a mission to \\\"Green Our World, One Home and Office at a Time.\\\"  Green Irene trains and supports local Eco-Consultants to assist in implementing proven green home and business solutions. Since 2007, Green Irene has grown into the largest green consulting firm in the United States with over 500 certified Eco-Consultants in 47 states.', 'As your local green friend, I am not a preachy green person and I believe it is hypocritical to encourage people to make lifestyle changes we wouldn\\\'t make ourselves.  I feel strongly that each of us can make a difference with simple changes in lifestyle and habits.  When you start to see results, like financial savings from lower utility bills, it helps reinforce bigger and more permanent lifestyle changes. I look forward to helping our local community make changes and become more sustainable.  Let\\\'s work together.', '0', '6', '0'), ('87', '1', '954', '', '860', 'Happy Valley Holistic Birth & Bodywork', '', 'Services', '88', '', 'http://www.facebook.com/HappyValleyHolisticBirth#!/HappyValleyHolisticBirth', '', '', '', '2010-07-21 00:00:00', null, 'Happy Valley Holistic Birth & Bodywork offers supportive services for women and families in the childbearing year, including massage therapy, prenatal yoga, labor support/doula services and childbirth education. HVHB is working to create a network of practitioners who offer professional services, classes, workshops, support groups and other community events in order to promote and facilitate wellness and informed decision-making regarding the many aspects of childbirth. Happy Valley Holistic Birth honors the wisdom of childbirth and recognizes each woman\\\'s right to give birth as she chooses.', 'Happy Valley Holistic Birth is the conception of Kerri Zelman, CMT. Kerri has lived in the Centre Region for almost 20 years. As a massage therapist in practice for the past four years, Kerri has made prenatal massage her focus and is now expanding her practice to include prenatal yoga, professional labor support and childbirth education. She is also expanding her vision to include multiple practitioners offering various services and events that support & promote women\\\'s wisdom and wellness in the childbearing year.', '0', '6', '0'), ('90', '1', '1052', '', '955', 'Kneading Body Spa', 'Walk ins are available Mon-Fri 10-6. Appointments are available any time to include weekends.\r\n24 hour notice needed for couples massage.', 'Health and Fitness', '91', 'www.kneadingbodyspa.com', 'http://www.facebook.com/home.php#!/pages/Philipsburg-PA/Kneading-Body-Spa/155492377816534', '', '', '', '2010-07-28 00:00:00', null, 'We are a day spa where pampering and healing can both be enjoyed. Offering a large variety of services to include massage, scrubs and wraps at an affordable price.', 'My name is Davina Haponski. I moved to Philipsburg in the summer of 2009 after completing my training as a Massage Therapist in Pittsburgh. My dream has always been to open my own day spa. After a year of living in Philipsburg, I had fallen in love with the town and decided to open a spa. \r\nI have two additional therapists Bruce and Caleb, and our office manager Amanda.', '0', '10', '0'), ('93', '1', '1096', '', '996', 'Energy Stewards', 'M-F 8a to 5p and by appointment', 'Services', '94', 'www.energystewardsinc.com', 'http://www.facebook.com/pages/State-College-PA/Energy-Stewards#!/pages/State-College-PA/Energy-Stewards/137755719592548?ref=ts&__a=7&ajaxpipe=1', 'http://twitter.com/EnergyStewards', '', '', '2010-08-02 00:00:00', null, 'Energy Stewards designs energy efficient lighting systems for office, retail, manufacturing and warehouse buildings to improve lighting and reduce electricity usage.', 'Founded by Scott Good from Goodco Mechanical, Energy Stewards is the preferred installer for Philips Lightolier in Central and Western Pennsylvania and Ohio. The Energy Stewards team includes BJ Clitherow, creator of the Going Green expo at the Grange Fairgrounds.', '0', '6', '0'), ('94', '1', '1129', '', '1028', 'The Philips Hotel & 1921 Restaurant', 'Daily 11:00 to \n8:00 p.m. Sunday thru Thursday;\n10 p.m. Friday and Saturday.\nDinner entrees are offered all day Sunday.\nThe marble bar and rooftop remain open as long as customers are enjoying themselves!', 'Bars & Restaurants', '97', 'www.ThePhilips1921.com', '', '', '', '', '2010-08-17 00:00:00', null, 'The Philips Hotel is a newly renovated historic building with fine dining, boutique hotel rooms and the Centre Region\\\'s only 7th floor Grand Ballroom with Sky Dining.  PLEASE JOIN OUR LOYALTY CAMPAIGN.  WHEN YOU DO, 10% OF YOUR PURCHASE AMOUNT WILL GO TO SUPPORT PHILIPSBURG MAIN STREET, OUR NON-PROFIT LOYALTY CAMPAIGN SHARING PARTNER.  Operated by the Philipsburg Revitalization Corp., Philipsburg Main Street is critical to our town\\\'s local economic development.  When you support us, you also help Philipsburg Main Street!', 'Originally built in 1921, The Philips Hotel is a local hallmark.  The hotel has been undergoing renovations since 2007 and is becoming a premier location to celebrate, entertain or just enjoy a nice dinner in a beautiful atmosphere.\n\nWe offer fine food in a beautiful dining room, complete with 20’ ceilings and the original 1921 brass chandeliers.  We have newly renovated hotel rooms and, of course, our Grand Ballroom and Sky (rooftop) dining.  Opening soon will be the Presqueisle Pub, an Irish Pub done right.\n\nThe Philips is committed to its past and its present.  We invite people to share their experiences, or their family member’s, on our webpage, “My Family Remembers”.  We constantly hear stories of weddings, proms, anniversary parties, of singing to the residents when it was an assisted living facility, of our honorable veterans watching for unfriendly planes from the rooftop during WWII….it goes on and on, and we cherish every story!\n\nPlease become a new friend The Philips, and create new memories to pass down through the generations.', '0', '35', '0'), ('95', '1', '1169', '', '1065', 'Cool Beans Coffee and Tea', '', 'Bars & Restaurants', '98', 'www.coolbeancoffeeandtea.com', 'http://www.facebook.com/pages/Bellefonte-PA/Cool-Beans-Coffee-and-Tea/273651182810?v=wall', '', '', '', '2010-08-26 00:00:00', null, '141 West High Street, Bellefonte, PA  16823  --   Cool Beans is a great local coffee shop, and a whole lot more. ‘We believe in good brews -- and we believe in our community.’', '', '0', '67', '0'), ('96', '1', '1171', '', '1066', 'Dos Locos Mexican Restaurant & Tequila Bar', '', 'Bars & Restaurants', '100', '', '', '', '', '', '2010-08-26 00:00:00', null, 'Located downstairs from Alto Italian Restaurant in Lemont - Entrance alongside building down the stairs.', '', '0', '47', '0'), ('97', '1', '1173', '', '1067', 'Alto Italian Restaurant and Bar', 'Monday-Thursday 5:30pm to 9pm; \nFriday-Saturday 5:30pm to 10pm', 'Bars & Restaurants', '99', 'http://www.altoitalian.com/alto.html', '', '', '', '', '2010-08-26 00:00:00', null, 'Alto’s cuisine showcases seasonal, fresh, and local ingredients in an authentic Italian fashion.  We are located in Lemont and we aim to serve as a special landmark that adds to the distinct culture of our community.  You will find an emphasis on dishes which represent both the Northern and Southern regions of Italy.  In addition, you will experience an extensive wine list made up of over 140 Italian selections, chosen to pair with the delicious food we serve.  PLEASE JOIN OUR LOYALTY CAMPAIGN.  WHEN YOU DO, 10% OF YOUR PURCHASE AMOUNT WILL GO TO SUPPORT THE SECOND MILE, OUR NON-PROFIT LOYALTY CAMPAIGN SHARING PARTNER. The Second Mile is an organization committed to serving the youth of Pennsylvania.  Specifically, these funds will benefit youngsters from across the Commonwealth who attend The Second Mile\\\'s Summer Challenge Camp Program.  To learn more about this non-profit, please go to www.thesecondmile.org.', 'Built in 1892, the Victorian structure located at 901 Pike Street in Lemont has been a landmark restaurant in Central Pennsylvania since 1977. Operated as the Victorian Manor from 1977-2005, the establishment created a sound reputation for fine dining and developed a loyal following.  In late 2005, the owners of “The Manor” retired and sold to Dave Fonash and Paul Kendeffy of the Fonash.Kendeffy Restaurant Group.  Throughout the winter of 2005, the classically ‘Old-World’ building was given a cosmetic facelift, creating a brighter, architecturally cleaner, and more open feel. All of the refurbishing was done by the partners, management and family with intense attention given to both bars and the kitchen. The renovation results of the downstairs area were quite dramatic and a new bar and open private dinning space took form.  \n\nIn April 2006, the transition was completed and Alto Italian Restaurant and Bar opened. The reviews of the food and space have been excellent. \n\n“Formerly the Victorian Manor, Alto has been completely and magnificently refurbished and the food is superb…incidentally, the downstairs bar is something of a revelation. It’s the type of upscale, old world lounge one would presumably find in Tuscany or Naples…” State College Magazine', '0', '30', '0'), ('98', '1', '1175', '', '1068', 'Mario & Luigi\\\'s Italian Restaurant', 'Mon-Thurs: 11:30pm - 2:00pm / 4:00pm - 9:00pm\n\nFri: 11:30pm - 2pm / 4:00pm - 10:00pm\nSat: 11:30am - 10:00pm\nSun: 12 Noon - 9:00pm', 'Bars & Restaurants', '101', 'http://www.dantesinc.com/marioandluigis.htm', '', '', '', '', '2010-08-30 00:00:00', null, 'Mario\\\'s has become the Italian tradition in State College - Mario\\\'s offers an extensive menu in unique surroundings. Mario\\\'s was the first restaurant in the area to offer wood fired pizza. These individual pizzas with their crispy crust and unique toppings have become an area favorite. In addition, Mario & Luigi\\\'s features a wood fired rotisserie where you can find veal, chicken, lamb or pork roasts on a nightly basis. Mario\\\'s offers a wide assortment of authentic features such as pasta, fresh seafood, chicken, formula fed veal, entrée salad and other regional specialties. Featured favorites include Mario\\\'s annual garlic festival, Asparagus festival, mushroom festival and Carnevale.\n\nMario\\\'s has become famous for our original vodka sauce, a delicious tomato cream sauce that goes perfectly with any pasta. Desserts are a specialty as well, with selections ranging from Tiramisu to Italian Rum Cake. Our menu derives its authenticity from the owner, a first generation Italian, who makes annual pilgrimages to Italy seeking out new food ideas.', 'Andrew A. Zangrilli \\\"Andy\\\", President and Chief Executive Officer of Dante\\\'s Restaurants, Inc. began his career in the food service industry at the age of 13 in a pizza shop in Altoona, PA. Through hard work and dedication to his job, he became manager by the age of 19. When he came to Penn State at the age of 22, he persuaded his employer to form a partnership with him and open in State College. The result was the Hi-Way Pizza Cut-Pie Shop, which began operation in 1963. This was followed by the Hi-Way Pizza Round-Pie Shop.\n\nIn 1970, Andy bought out his partner and set his sights on expanding the business.\n\nIn 1973, Andy purchased the Nittany Lodge in State College and opened it as The Deli Restaurant. The Deli features sandwiches, homemade soups, fresh salads, and moderately priced entrees.\n\nGullifty\\\'s was a new concept, incorporating the best menu items from each of the earlier endeavors. The name \\\"Gullifty\\\'s\\\" came from the children\\\'s television program Mr. Roger\\\'s Neighborhood, because of its uniqueness. Andy chose the name Gullifty\\\'s to represent the unique eatery concept.\n\nIn 1976 The Saloon opened in State College. Patterned after a turn-of-the-century English Pub, The Saloon features superb drinks, and entertainment.\n\nIn the fall of 1989 Hi-Way Pizza\\\'s Cut Pie and Round-Pie shops combined to become Hi-Way Pizza College Avenue. In March 1990, after much hard work and masterminding, Andy opened Mario & Luigi\\\'s. Mario & Luigi\\\'s offers an extensive menu serving authentic Italian dishes in a wonderfully vivacious atmosphere.\n\nDante\\\'s newest concept, Bar Bleu and Bar Que opened its doors in the fall of 2002. Bar Que features homemade authentic Kansas City style smoked bar-b-que. Bar Bleu, located downstairs, promotes live jazz, blues and roots rock in an eclectic cocktail lounge with a neon blue bar featuring premium pours.\n\nIn State College, there is also a pastry shop and bread commissary where food items such as pastries, desserts and freshly baked rolls are prepared daily. All of these baked goods are packaged and hand shipped to various locations so that our customers can enjoy the quality, consistency and freshness that they deserve. Whole pies, cakes and other desserts can also be purchased through our commissary.\n\nDante\\\'s Restaurants, Inc. provides for it\\\'s State College residents a wide variety of menu concepts from which to choose; from the fine cuisine of Mario & Luigi\\\'s to the extensive menu selections at The Deli Restaurant to the fun and exciting Hi-Way Pizza menus with 28 years of tradition.', '0', '35', '0'), ('99', '1', '1177', '', '1069', 'Mt. Nittany Inn', 'Monday - Closed (open February 14)\nTuesday - 11:00am-8:00pm\nWednesday - 11:00am-8:00pm\nThursday - 11:00am-8:00pm\nFriday - 11:00am-9:00pm\nSaturday - 11:00am-9:00pm\nSunday - 11:00am-8:00pm (first Sunday of every month 10:00am-8:00pm)\nFirst Sunday of every month we offer the brunch buffet from 10:00am-2:00pm\nPlease call ahead in inclement weather.', 'Bars & Restaurants', '102', 'http://www.mtnittanyinn.com/', 'http://www.facebook.com/home.php#!/pages/Mt-Nittany-Inn/182362762959', '', '', '', '2010-08-30 00:00:00', null, 'Celebrate Valentine\\\'s Day at The Mt. Nittany Inn.  Our Valentine\\\'s Menu is available Friday-Monday (we are open Monday, February 14).  Make your reservation today.  MARDI GRAS SPECIALS AVAILABLE FRIDAY NIGHTS IN FEBRUARY AS WELL!  Click on our website below to learn more.  Perched at the summit of Centre Hall Mountain overlooking picturesque Penns Valley, the Mount Nittany Inn is an exquisite setting for a memorable lunch, dinner or Sunday brunch.  The historic location and world-class menu offer you a unique dining experience that’s ideal for casual get-togethers, special occasions and catered group affairs.  Our menu is a blend of classic recipes and new favorites…all chef-prepared with the freshest, top quality ingredients. Visit our newly renovated restaurant and experience the Mount Nittany Inn -- a Central Pennsylvania landmark since 1919.', 'In 1919, Pete Coldron opened a roadside stand to provide light fare to the travelers who often stopped to fill their radiators after the long, slow journey up the mountain. His stand became so popular that in 1928 he constructed the original restaurant, which continued to draw crowds. Since those early days, the restaurant grew to include a coffee shop, grill and bar.\n\nmore\n\nThe first significant improvements were made by Bill and Betty Zang, who purchased the Inn in 1975. A new partnership purchased the Inn and in 1991, relocatingthe kitchen, refurbishing the bar, and adding extensive decking and a large Bed and Breakfast addition with 10 rooms overlooking the view, each with balconies.\n\nThe first of two tragedies struck in April 2003 when a fire originating in the kitchen caused substantial damage. Rebuilt in 2004, and just months from re-opening, fire again struck the Inn. Despite the efforts of firefighters from across the county, the Inn was totally destroyed.\n\nA one-of-a-kind location and loyal customers provided the incentive to rebuild the Mount Nittany Inn and to reclaim its place as the “top” restaurant in the region. In November 2008, the Mount Nittany Inn reopened. It retains the character of the original restaurant but offers an open, airy atmosphere, additional seating, banquet space for 100 and an expanded outdoor deck area. With spectacular views at every turn, there isn’t a bad seat in the house.\n\nThe Mount Nittany Inn offers lunch and dinner seven days a week in one of our comfortable dining rooms, the sophisticated “Looking Glass” lounge, or outside on our expansive deck, where you can enjoy some of the most dramatic dining in Pennsylvania-no matter what the season. The Mount Nittany Inn also is perfect for banquets, business meetings, celebrations and receptions.\n\nThe Mount Nittany Inn is conveniently located on Route 144 near Penn\\\'s Cave, the Grange Fair Grounds, Amish Country, Historic Bellefonte, Tussey Mountain Ski Area, and Penn State.', '0', '194', '0'), ('102', '1', '1192', '', '1081', 'Zimedia Enterprises', '', 'Services', '105', 'http://zimediaenterprises.com', 'http://facebook.com/zimmett', 'http://twitter.com/ericsadblog', '', '', '2010-09-07 00:00:00', null, 'Zimedia Enterprises does websites, logos & marketing. Really the whole process of forming a business. If you\\\'ve already got a logo & website, then let us help you with your marketing. Like when to use Radio, TV or Newspaper. We\\\'ve also been known to give excellent motivational advice (true story).', '\\\"Zimedia encompasses everything I love to do: work with people, design, dream, create and help others achieve their goals.\\\" \n-Eric B. Zimmett \\\"I believe if you don\\\'t enjoy what you do, quit doing it!\\\"', '0', '0', '0'), ('103', '1', '1201', '', '1089', 'State Farm Insurance, George Stone, Agent', 'M-F 9-5\r\nWeekends and evenings by appt', 'Other', '106', 'www.UareCovered.com', '', '', '', '', '2010-09-10 00:00:00', null, 'State Farm Insurance offers most lines of insurance, financial services and banking products', 'Our business is locally owned by George Stone who has over 23 years experience in the insurance industry', '0', '4', '0'), ('104', '1', '1232', '', '1119', 'Out of the Box Professional Coaching', 'Monday through Friday 9-4 and many Saturdays for workshops and retreats.', 'Other', '107', 'http://www.outoftheboxlifecoaching.com', 'http://www.facebook.com/OutoftheBoxCoaching', 'http://www.twitter.com/ootbcoaching', '', '', '2010-10-04 00:00:00', null, 'Professional coach partnering with you to unleash your full potential.  Whether you are a small business owner looking to build a strong team or take your business to the next level, or an individual looking to balance your work and life or take your life to the next lever, Out of the Box Coaching can help you with all of your coaching needs.  Out of the Box Coaching partners with people so they can create a more balanced life, accomplish goals, find success and live a fulfilling life.  We provide individual and group coaching, executive and business coaching, along with retreats and workshops.  All services can be customized to meet your needs.', 'Several years ago I didn’t know that I was trapped in a box, but I did know that something was not right. I was trapped in a job that was draining me. A job that was not true to who I was. I was living a life in conflict. I would go to my 9 - 5 job as one person and come home as ME. The emotional stress and unhappiness that I felt was beginning to take its toll. I knew I was at a point that something had to give. The greatest gift that I gave myself at that time, was the gift of listening to my inner voice, instead of the outside voices. I really listened to that inner voice which resulted in a fundamental shift of my perspective, my life, and the birth of OUT OF THE BOX Coaching!\nI am now a certified coach! I am also the mother of 2 boys and owner of OUT OF THE BOX Coaching.\nI am certified through The Coach Training Alliance, and The Institute for Life Coach Training. I have also taken courses through The Coaches Training Institute. I have a bachelors degree in Social Work from West Virginia University. I am a national speaker, having presented to several organizations, including: the NYPD and the State College Area School District. I also have conducted retreats across the country.', '0', '5', '0'), ('105', '1', '1234', '', '1120', 'Schlow Centre Region Library', '', 'Clubs and Non-Profits', '108', 'http://www.schlowlibrary.org', 'http://www.facebook.com/pages/State-College-PA/Schlow-Centre-Region-Library/32263412175', 'http://twitter.com/schlowlibrary', '', '', '2010-10-05 00:00:00', null, 'Schlow Centre Region Library opens doors for members of our diverse community to gather, share, and discover a wealth of ideas, the joy of reading, and the power of information by providing services and resources in a welcoming, convenient and responsive manner.', 'Mission:  Schlow Centre Region Library will be our community\\\'s best and most sought after gathering place where all are welcome to pursue their interests, learn new skills, express their creativity, interact with other members of the community, and enhance their quality of life.  Organization:  Schlow Library is governed by a nine member Board of Trustees appointed by the municipal governments in the Centre Region. Board members serve for three year terms and may only be reappointed once. They represent the community the library serves. The group is a mix of men and women who come from a variety of professions and backgrounds. Individuals appointed to the library board must have a commitment to the importance of library service and a willingness to devote the time and effort required.', '0', '24', '0'), ('106', '1', '1237', '', '1122', 'The IngleBean Coffee House', '', 'Bars & Restaurants', '109', '', 'http://www.facebook.com/pages/Millheim-PA/The-IngleBean-Coffee-House/138943296137927', '', '', '', '2010-10-06 00:00:00', null, 'The IngleBean will serve locally sourced coffee, tea and food to customers in a setting that highlights regional and natural history.  We will host regular events from game nights and knitting circles to open mics and film screenings.  We hope to create a unique and welcoming business while supporting the larger Penn\\\'s Valley community.', '', '0', '5', '0'), ('107', '1', '1242', '', '1126', 'Crawford\\\'s Bakery', '', 'Services', '110', '', 'http://www.facebook.com/#!/pages/Philipsburg-PA/Crawfords-Bakery/109419545754028', '', '', '', '2010-10-07 00:00:00', null, 'Special Order Cakes and Cupcakes for all occasions.', 'Kate started decorating cakes at the tender age of 16 after school she would walk across the street to a local grocery store and decorate in the evenings. Eventually working her way to management. As life takes many paths she took a hiatus from Bakery work got married and started a family but always had an idea to do cakes from home some day so she could be home for her family but make some extra income. So these days Kate can have her cake and eat it too. With hopes to eventually build a small cottage on her property to house the bakery. Currently we just do cakes and cupcakes made to order.', '0', '8', '0'), ('108', '1', '1246', '', '1129', 'Cyclone Advertise', '', 'Services', '111', '', '', '', '', '', '2010-10-09 00:00:00', null, '', '', '0', '1', '0'), ('109', '1', '1260', '', '1141', 'Envinity', 'Monday-Friday, 9:00-5:00', 'Other', '112', 'www.envinity.com', 'http://www.facebook.com/pages/State-College-PA/Envinity/118262608231577?ref=ts', 'http://twitter.com/EnvinityPA', '', '', '2010-10-18 00:00:00', null, 'Envinity integrates green design, construction, and energy to holistically serve commercial and residential clients throughout Pennsylvania.', 'Envinity started as a green building company, and has since expanded to offer energy services. These include commercial and residential energy audits, and installation of renewable energy systems such as solar and geothermal.', '0', '5', '0'), ('110', '1', '1265', '', '1145', 'Macaroni Kid State College-Philipsburg', 'By appointment.', 'Services', '113', 'www.statecollege.macaronikid.com', 'http://www.facebook.com/macaronikid', '', '', '', '2010-10-21 00:00:00', null, 'Macaroni Kid is a free, weekly email newsletter that lists family friendly events in the State College, Bellefonte, and Philipsburg areas. We also feature national and local advertisers of family friendly businesses, road trip destinations, interviews, product reviews, helpful tips and give-aways!', 'Macaroni Kid National was established in 2008 and was brought to the local level in early 2010. We are a trusted resource that will enable you to spend more quality time with your children and families as well as provide you with affordable advertising rates to spread the word about your business!', '0', '5', '0'), ('111', '1', '1274', '', '1153', 'Room Doctor Furniture Co.', '', 'Other', '114', 'http://www.roomdoctor.com/', 'http://www.facebook.com/home.php?#!/pages/State-College-PA/Room-Doctor/132398030142426', '', '', '', '2010-10-25 00:00:00', null, 'We locally design and manufacture eco-friendly, solid wood furniture.  Since 1989, we have offered affordable furniture lines including futons, platform beds, mattresses, bunks, lofts, bookshelves, and more.  Stop into our store on East College Ave. or click on our website below to learn more about our locally-owned, sustainable business.', 'Room Doctor Furniture Co. was founded in 1989 under the idea of designing & manufacturing low-cost, American-made, solid-wood furniture. Now, at a time when cheap imports are the products du jour and the once-dominant American Furniture Industry is but a shadow of it’s former stature, we continue to hold to our roots. \n\nOur line of eco-friendly furniture is unmatched in terms of cost, durability and sustainability. We primarily use Southern Yellow Pine, our nations’ most abundant, sustainably-harvested wood source to produce our lines of futon frames, platform beds, bunk & loft beds, bookshelves and other coordinating pieces. We will also soon be adding a complete line of Organic futons and bedding to compliment our furniture! \n\nWe believe in environmental and social responsibility and are dedicated to promoting these ideals as a new business model, Eco-Social Capitalism, a term coined by the company’s president and founder, Tom Meade. Our commitment is to help our employees and community grow and prosper by providing safe, chemical free home furnishings under our Xtreme Furniture brand while our longer-term goal is to achieve energy independence using a combination of wind, solar, geo-thermal, and bio-mass resources. \n\nOur goal is to share this vision with our customers to sow the seeds for the urgently required transformational change that will shape not only our future but that of our children and all future generations.', '0', '4', '0'), ('113', '1', '1291', '', '1167', 'Lovely Mud Pottery', '', 'Other', '0', '', '', '', '', '', '2010-11-01 00:00:00', null, '', '', '0', '3', '0'), ('114', '1', '1387', '', '1261', 'Artemis Massage Studio', 'We are by appointment only.\n\nPlease call ahead, or submit a request via our website at www.ArtemisMassageStudio.com \nor by calling  814-237-1820.', 'Health and Fitness', '116', 'http://www.ArtemisMassageStudio.com', 'http://www.facebook.com/pages/State-College-PA/Artemis-Massage-Studio/310570004435?ref=ts', 'http://www.twitter.com/artemismassage', 'http://www.youtube.com/user/artemismassagestudio', '', '2010-11-14 00:00:00', null, 'Located in downtown State College, Artemis is your premiere destination for luxurious, individualized massage experience.\n\nArtemis offers a full range of styles of massage including: Shiatsu, Swedish, Relaxation, Reflexology, Deep Tissue, Sports, and Prenatal.\n\nAny style may be requested and all rates are consistent with those of Signature Massage.\n\nNot sure what\\\'s best for you? After conferring with your therapist, some styles may be combined in a single session to ensure you bodywork fits your personal lifestyle needs.\n\nUnlike most spas and massage centers, Artemis offers full contact time.', 'The Artemis Signature Massage.\nCombination Shiatsu and Swedish modalities; includes spinal heat therapy.\n\n30 mins : $40\n60 mins: $60\n90 mins: $90\n\nArtemis Couples Massage\nEnjoy tandem massage with a friend or loved one; includes cabernet-colored linens and two chocolate-hazelnut croquantes.\n\n30 mins: $80\n60 mins: $120\n90 mins: $180\n\nCompliment your massage...\n\nAdd a 30-minute facial for $25\n\nAdd a hot towel treatment with French lavender oil to any massage for $10\n\nRegular clientele...\n\nPurchase four 60-minute sessions up-front and a receive a special rate of $220.\n\nArtemis specialized in customized massage experiences...\n\nIf you are celebrating a birthday, anniversary, engagement, or graduation, our trained staff revels in tailoring massage experiences to fit your vision.\n\nPlease inquire as to how we can ensure your occasion is as unique as you are!', '0', '3', '0'), ('115', '1', '1433', '', '1306', 'The Russell Organization', '8:00 AM to 6:30 PM Eastern time', 'Services', '117', 'http://planetrussell.com/blog/', 'http://www.facebook.com/planetrussell', 'http://twitter.com/planetrussell', '', '', '2010-11-19 00:00:00', null, 'The Russell Organization is a comprehensive web design and  development firm, and a provider of social media solutions, with over 12 years of unmatched experience serving small business, academic, government and corporate clients, including L. Robert Kimball, the Shaner Companies and Rex Energy Corp.', 'Great things are happening, so we\\\'re updating out story...and like all the best stories, it\\\'s a true one!\n\nAre you outstanding in your field? (Not just out, standing in your field.) We are also exploring expert speaker representation. Call Mike Russell at (814) 883-4066 for additional infromation.', '0', '1', '0'), ('116', '1', '1487', '', '1359', 'No Knock Lending Library at Houseasaurus', '', 'Clubs and Non-Profits', '118', 'http://centralpacommunityhousing.org/', 'http://www.facebook.com/pages/Houseasaurus-Co-op/134462925505', '', '', '', '2010-12-12 00:00:00', null, 'Central PA Community Housing (aka the co-op and Houseasaurus) is a housing cooperative located in Central Pennsylvania that formed in 2005. We strive to provide sustainable, socially and environmentally responsible housing by and for members.The Co-Op is home to the No Knock Lending Library.\n\nLocated within several common spaces of The Co-Op’s two houses, The No Knock Lending Library will be freely open to the public from 5-10pm on weekdays and 12-5pm on weekends. As the name of the library suggests, there’s absolutely no need to knock before coming into either of our houses. Just come on in and introduce yourself if you happen to see anyone.\n\nWe are currently cataloging the library into fiction and nonfiction sections in an online database. We offer a wide range of book topics, including:\n\nAnarchism, Armed Struggle, Atheism, Ecology, Economics, Fascism/Anti-Fascism, Feminism, Fiction, Gender/Women/Feminism, Globalization, Graffiti, Health, History, How-To/Reference/DIY, Imperialism/De-colonization, Indigenous, Kids/Education/Family, Labor, Latin America, Left Communism, Media, Middle East, Music, Philosophy/Critical Theory, Poetry/Songs, Prisons/Prisoners, Punk, Queer, Race, Religion/Anti-Religion, Revolution, Sex, Technology, Terrorism/War/Militarism, Vegetarian/Animal Rights, Work', '', '0', '0', '0');
INSERT INTO `business` VALUES ('117', '1', '1490', '', '1361', 'Applemama', '', 'Other', '119', '', '', '', '', '', '2010-12-13 00:00:00', null, '', '', '0', '1', '0'), ('118', '1', '1492', '', '1362', 'Nittany Valley Organics', 'Availabl on the internet 24/7/364 - sorry we are closed for Christmas.', 'Other', '120', 'http://www.nittanyvalleyorganics.com', '', '', '', '', '2010-12-14 00:00:00', null, 'Nittany Valley Organics produces certified organic bar soaps, organic liquid soaps, organic foaming hand soaps, organic shampoo, organic skin care products, organic household cleansers, organic claners, soap nuts and 100% soy candles.', 'Organic products are good for your body, contain no harmful ingredients and are all natural.', '0', '1', '0'), ('119', '1', '1500', '', '1369', 'Greener Pastures No Kill Animal Rescue', '', 'Clubs and Non-Profits', '121', 'http://www.greenerpasturespa.com', 'http://www.facebook.com/?ref=logo#!/pages/Greener-Pastures-No-Kill-Animal-Rescue/106506432732463', '', '', '', '2010-12-27 00:00:00', null, 'Tirelessly rescuing neglected and abused animals, of all sizes, in the four state area - since 2000.', 'Greener Pastures No Kill Animal Rescue was founded by Samantha Frey in 2000. We take in animals, both large and small, of the most severe cases of neglect, abuse or injury.     \n   We currently care for over 200 animals at our Rescue, including dogs, cats, horses, donkeys, sheep, goats, geese and ducks, chickens, and pigs. All too often, an animal arrives at our doorstep an innocent victim of neglect or cruelty.\n   Greener Pastures exists solely on private donations. Your donations and compassion give all of the animals at Greener Pastures so very much to be thankful for. Food...to nourish their bodies, Shelter...to keep them dry and warm, Medication...to gently treat their wounds and sicknesses, and the reassurance of Endless Love, Attention, and a Life of Dignity. Without Your Generosity, This Would Not Be Possible!', '0', '0', '0'), ('120', '1', '1505', '', '1373', 'DoodyPro Dog Waste Removal Service', '', 'Services', '123', 'http://www.doodypro.net/', 'http://www.facebook.com/?ref=home#!/pages/DOODYPRO-Dog-Waste-Removal-Service/154809836127', '', '', '', '2011-01-15 00:00:00', null, 'We are Central \nPennsylvania\\\'s Professional Dog Waste Clean Up Service. \n   Providing weekly,2x weekly, biweekly, and 1x cleanings for most of Centre County, and Tyrone of Blair County.', 'DOODYPRO is a locally run business.Started in 2008. Owned by Talen D. Von Gunden, and family, of Bellefonte, PA. Our family is native to the State College Area , and we are looking forward to offering dependable service at a fare price to our local community and friends. We promise to strive to be your favorite service.  We believe in America, and doing right by our customers. This is why we do not use contracts. We believe your word to pay on time, and give our word to be fare and do our best always. We guarantee satisfaction.', '0', '0', '0'), ('121', '1', '1507', '', '1374', 'Room to Breathe', '', 'Services', '124', 'http://www.roomtobreathe.us/', 'http://www.facebook.com/pages/Room-to-Breathe-Home-Organizing-Staging/135962919770935?ref=ts&__a=10&', 'http://twitter.com/EWEstatecollege', 'http://www.youtube.com/watch?v=2QfNlPn0s0w', 'http://www.youtube.com/watch?v=AGra4VeOrjQ', '2011-01-17 00:00:00', null, 'Room to Breathe Home Organizing and Staging offers you an organized and balanced life.  Clutter is a common result of today’s busy lifestyles, leaving us longing for simplification, time, and peace of mind.  Organizing and managing the out-of-control areas of your life is exactly why Room to Breathe was created.  Learn more about becoming happy and organized by viewing our website and videos below.  We can make an enormous change in your life, home, and office!  Contact us anytime at info@roomtobreathe.us.', 'Hi, my name is Jessica Dolan and I AM a Professional Organizer.  I started my locally-owned business to BRING ORDER to our wonderful community, one house at a time.  I really love what I do and I know that I can make great changes to people\\\'s lives, homes, and offices.  Some of you may be asking yourselves \\\"what the heck is a professional organizer?\\\"  A professional organizer enriches your life by helping you to decrease stress, increase productivity, and increase efficiency by improving your physical environments, saving you money, and allowing you to regain time for yourself.  This is done by designing systems that use simple organizing principles designed uniquely around you and your situation.  I encourage you to check out the videos posted on my page to learn more.  And, connect with me on Facebook.\n\nOne more thing:   As a local business owner, I am very committed to our community.  I\\\'m the past President of WiNGS (Women\\\'s Network Group), a member of NAPO (National Association of Professional Organizers), and Creator of EWE (Entrepreneurial Woman\\\'s Expo).  In addition, I\\\'m a 2008 graduate of Leadership Centre County and I was recognized as one of PA\\\'s Best 50 Women in business in 2008.', '0', '3', '0'), ('122', '1', '1515', '', '1381', 'American Chiropractic Spa and Retreat', '', 'Services', '0', '', '', '', '', '', '2011-02-07 00:00:00', null, '', '', '0', '0', '0'), ('123', '1', '1519', '', '1384', 'Bliss- A Full Service Salon', 'Tuesday through Saturday 10-6', 'Services', '125', 'www.blissafullservicesalon.com', 'http://www.facebook.com/home.php#!/pages/Bliss-A-Full-Service-Salon/136968509678110', '', '', '', '2011-02-23 00:00:00', null, 'Bliss is an Aveda Concept Salon, featuring the entire Aveda product lines. Our services include haircutting, color, foil highlighting, waxing, manicures, pedicures, updos, skincare and make up.', '', '0', '1', '0'), ('124', '1', '1525', '', '1389', 'Cafe Lemont', '', 'Bars & Restaurants', '127', '', '', '', '', '', '2011-03-16 00:00:00', null, '912 Pike St. (Suite 103), Lemont, PA  16851 – We are that place on the corner!   We offer an eclectic socially-conscious coffeehouse that serves an \\\"out of the ordinary\\\" mix of light fare lunch items and more traditional coffee pairings like cookies, brownies and cakes.  Come by to grab a latte and relax with friends.  We aim to bring something unique to our community, something that only locally-owned businesses can do authentically.', '', '0', '0', '0'), ('125', '1', '1534', '', '1397', 'Pita Cabana Grill - Fresh Lebanese Cuisine', '', 'Bars & Restaurants', '126', 'http://pitacabanagrill.com/Home.html', '', '', '', '', '2011-03-22 00:00:00', null, '428 E. College Ave (beneath McLanahan’s), State College, PA 16801 -- Everything here is natural, healthy and fresh. In other words, they do authentic Mediterranean the right way.', '', '1', '10', '0'), ('126', '1', '1550', '', '1412', 'Lipstick Salon and Color Lounge', '', 'Services', '128', 'http://www.lipsticksalon.com/', '', '', '', '', '2011-04-01 00:00:00', null, '135 East Beaver Ave, State College PA, 16801 -- Lipstick has the expertise to bring out your best and a range of services for any need or budget. Experienced and friendly stylists are standing by to help you with all of your hair, nail and other beauty service needs. Complimentary wine and coffee; it\\\'s a friendly place that takes your look as seriously as you do.', '', '0', '0', '0'), ('127', '1', '1553', '', '1414', 'Zola New World Bistro', '', 'Bars & Restaurants', '129', 'www.zolabistro.com', '', '', '', '', '2011-04-04 00:00:00', null, '324 West College Avenue, State College, PA 16801 – Innovative contemporary cuisine, with an award-winning wine list and exceptional service.', '', '1', '15', '0');
COMMIT;

-- ----------------------------
--  Table structure for `campaign`
-- ----------------------------
DROP TABLE IF EXISTS `campaign`;
CREATE TABLE `campaign` (
  `campaign_id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `business_id` int(11) NOT NULL,
  `min_amount` int(4) NOT NULL DEFAULT '0',
  `max_amount` int(4) NOT NULL DEFAULT '999999',
  `milestone` int(11) NOT NULL,
  `success_date` date DEFAULT NULL,
  `expiration_date` date DEFAULT NULL,
  `date_created` datetime DEFAULT NULL,
  `reason` text NOT NULL,
  `incentives` text,
  `active` int(1) NOT NULL DEFAULT '0',
  `name` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`campaign_id`)
) ENGINE=InnoDB AUTO_INCREMENT=66 DEFAULT CHARSET=latin1;

-- ----------------------------
--  Records of `campaign`
-- ----------------------------
BEGIN;
INSERT INTO `campaign` VALUES ('1', '4', '20', '800', '1000', null, '2009-12-31', '2009-09-15 00:00:00', 'I am launching a Cogster Loyalty Campaign because I would like to enhance my photography equipment to promote better visual settings for my clients.  Specifically, I want to purchase additional back-drops, props, and lenses to serve my customers.  \r\n\r\nIn addition, I want to continue to market and promote my new Boudoir line, Central Pennsylvania\\\'s hottest, one-of-a-kind photography line for women.  In order to achieve all this, I set a milestone of $1,000 to get started.  However, my overall goal is to accept Cosgter purchases until I reach $4,000.  So, pledge your loyalty and help me better serve Central Pennsylvania.  Your help means a lot to my business vitality.', '', '1', null), ('3', '5', '0', '999999', '200', null, null, '2009-09-15 00:00:00', 'put reason here', null, '0', null), ('12', '10', '20', '500', '1000', null, '2009-12-31', '2009-09-15 00:00:00', 'I am launching a Cogster Loyalty Campaign so that I can purchase computers and software to outfit my new computer learning center located in the Surface Artist Cooperative.  My ongoing campaign of $20,000 will allow me to continue to add software, PCs, and MACs to my learning center so that I can cover a wider range of topics in my computer-related workshops.', '', '0', null), ('28', '20', '20', '50', '1000', '0000-00-00', '2011-04-30', '2009-09-15 00:00:00', 'The Gamble Mill is proud to offer the finest of classic American dishes and some really outstanding locally-crafted beers. We are launching this project to enable us to expand our menu and bring a number of new tasty, hoppy, and malty treats to our loyal customers in the Happy Valley. You can see the fruits of this project during our \\\"Chalkboard Sundays\\\" -- every Sunday from 4-8pm we\\\'ll have a new variety of menu items to choose from. Come by and tell us what you think! Thank you for supporting quality local cuisine in Central Pennsylvania.', '', '0', 'The Microbrew Project'), ('29', '19', '20', '50', '5000', '0000-00-00', '2011-02-28', '2009-09-15 00:00:00', 'Join our campaign to raise $5,000.  We want to enhance our dining environment for you and maybe even provide an outdoor seating area next Spring!   By joining Zola\\\'s Campaign, you can double your money in 90 days.  PLUS, just for joining, you\\\'ll get an additional $10 OFF at Dos Locos, our exciting new Mexican Restaurant and Tequila Bar in Lemont!  That\\\'s right, join our Zola Campaign, double your money, and get $10 off at Dos Locos.  Thanks for supporting our locally-owned business.', '', '1', null), ('48', '67', '10', '40', '500', '0000-00-00', '2010-12-31', '2010-06-22 00:00:00', 'I would like to expand Shear Spirit Hair Salon by providing organic pedicure services as well.  With your local support, I will be able to expand my range of organic beauty services for Bellefonte and the surrounding area.', '', '1', null), ('49', '78', '10', '40', '40000', '0000-00-00', '2010-12-31', '2010-07-15 00:00:00', 'Join my Campaign and help my business prosper at its new location!  You may join for as little as $10.  Your local dollars are pooled together with those of many other community residents and count toward my goal of raising $40,000.  I will use these proceeds to renovate and open our wonderful, new space on Beaver Avenue.  In return, you receive Cogster Cash rewards worth more than what you pay to join!  You may use this Cogster Cash when you visit Webster’s.  Select “8-Week Double Money Option” and receive Cash worth 25% of what you pay, per week, for 8 weeks (200% payback!).  For this option, use Cogster’s secure online payment system.  The maximum payment is $40.  Or, if you choose, select “15-Month Long-Term Support Option” and receive Cash worth 10% of what you pay, per month, for 15 months (150% payback!).  The maximum payment is $500.  Please pay by check; see the details noted in the “Kicker” section.  Thank you for making an impact on your community!', '', '1', null), ('52', '94', '10', '100', '5000', '0000-00-00', '2010-12-01', '2010-09-08 00:00:00', 'We are in the process of improving your downtown Philipsburg experience by opening the Presqueisle Pub!  The Pub will be located adjacent to our Philips Hotel and 1921 Restaurant location.  Once open, the Pub will offer regulars and visitors a meeting place to \\\"honor the past and celebrate the present\\\".  Join us as we raise $5,000 for this venture and memorialize your loyalty with us for years to come!  (How it Works:  Say you make a purchase of $100.  You get $50 Rewards today.  You get $50 more in 30 days.  Then, you get $50 MORE 30 days after that.  All you have to do is come dine with us at 1921 to redeem these rewards!)  Note:  Our Non-Profit Partner is Philipsburg Main Street.  10% of our Campaign proceeds will go to this organization.', '', '1', null), ('54', '97', '10', '50', '2500', null, '2011-01-31', '2010-10-20 00:00:00', 'Join our campaign to raise $2,500.  The proceeds will be used to preserve the architectural allure of this stylish local landmark.  You may join for as little as $10 and as much as $50.  Your local dollars will directly support this locally-owned restaurant.  In return, you receive payback in the form of Cogster Cash Rewards worth double what you pay to join!  How it Works:  Select “90-Day Double Money Option” and immediately receive Cogster Cash worth 100% of what you pay to join.  You have 30 days to use this Cash at Alto.  One month from the date you join, you’ll receive additional Cash worth 50% of your initial purchase.  Then, the following month, you’ll receive additional Cash worth 50% of your purchase.  Total payback over 90 days is 200%.  All you have to do each month is print your cash and come dine with us at Alto!   Our Non-Profit Sharing Partner for this campaign is The Second Mile.   10% of the proceeds will go to support its Summer Challenge Camp Program.', null, '1', null), ('55', '117', '10', '50', '500', null, '2011-12-25', '2010-12-13 00:00:00', 'We are going to improve our business with more advertisement and be able to offer occasional shipping deals.', null, '1', null), ('56', '119', '10', '100', '2000', '0000-00-00', '2011-03-01', '2010-12-27 00:00:00', 'Greener Pastures would like to raise this amount of money in order to help pay for damages in the expected Spring Flooding. Every year the local tributaries flood our lands, displacing our animals until the creeks crest. Please help us prepare for this years damages, including resident injuries, damaged enclosures, and lost supplies.', '', '1', null), ('57', '29', '10', '10', '250', '0000-00-00', '2011-06-01', '2011-03-11 00:00:00', 'Keeping your cool in the bakery business isn\\\'t always easy! Gemelli needs a new refrigerated pastry display case to keep some of those tasty morsels of wholesome goodness at just the right point of crispness to bring out their best biscuity sweet flavor. Support our project and we promise that you\\\'ll pick up something made with real flavor -- and real passion. Like our dark chocolate truffles, or our hazelnut vanilla brittle, or maybe from our selection of natural breads with delicious nuts, seeds and fruits. We are proud to be part of the community here in Happy Valley. We\\\'re also proud of our raisin bread!  Support our project and help us keep the tradition of local bakeries alive in Central PA. With this deal you pay $10 and get $20 to use during future visits.', '', '1', 'THE \\\'WE HAVE COOL PASTRIES\\\' PROJECT: a new pastry display case'), ('58', '95', '10', '10', '250', '0000-00-00', '2011-06-01', '2011-03-11 00:00:00', 'Cool Beans wants to expand its popular Art Classes for Children program. With your support, we can bring the joy of art to even more amazing children in Happy Valley!  Creative art sessions are currently held Wednesday and Thursday mornings for children beginning at age 2.   Stop by to learn more about enrollment.  Here\\\'s what your support for this project earns you:  With this deal you immediately receive $10 to use right away at Cool Beans, plus earn an additional $10 of Cogster Cash for use during future visits. Enjoy a foamy latte at our friendly little shop and support an amazing experience of artistic discovery for some local youngsters!  (Downtown Bellefonte location only.)', '', '1', 'THE \\\'BREWING UP SOME CREATIVITY FOR KIDS\\\' PROJECT: growing a children\\\'s art program'), ('59', '20', '10', '10', '300', '0000-00-00', '2011-05-31', '2011-03-18 00:00:00', 'The Brewery at The Gamble Mill is launching an expansion project to better serve our very discerning customers with classic American dishes and quality microbrews. We will be adding a few more flavors to our line-up. Have you tried our J. Rose Pale Ale? How about the Pig Iron IPA? (You should!) We aim to serve excellent food in a superb atmosphere and brew some really, really, great locally-crafted beer. Thank you for supporting local cuisine at a unique and historic location. With this deal, you pay $10 and get $20 to use immediately.', '', '1', 'The Microbrew Project: expanding our microbrew selection'), ('60', '125', '10', '10', '250', '0000-00-00', '2011-07-01', '2011-03-22 00:00:00', 'Pita Cabana Grill is expanding its mission to bring falafel, kabob, shishtawook and salad to the masses here in Happy Valley.   Support this project and help us deliver the freshness of our authentic cuisine.  We are proud to bring an ethnic touch to State College, and we look forward to serving our friends even more of our carefully prepared tasty food!  With this deal, you pay $10 and get $20 to use right away.', '', '1', 'THE \\\'MAKING IT REAL\\\' PROJECT: new items for an expanded menu'), ('61', '124', '10', '10', '250', null, '2011-06-01', '2011-03-29 00:00:00', 'With glorious spring in the air we are planning to add a cozy new outdoor seating area to our relaxing little coffeehouse.  We love it here in Lemont.  So, why not take on a spring project to add a little sunshine while you sit out back and enjoy good coffee and good times?  By supporting this project, you get $5 immediately and $15 to use during future visits at Café Lemont.  Thanks for your support... hope to see you soon.', null, '1', 'THE ‘NICE DAY TO SIT ON THE PORCH’ PROJECT'), ('62', '55', '10', '100', '1500', null, '2011-06-30', '2011-03-30 00:00:00', 'We would like to add a small shop to provide support for your yoga practice. We will offer mats, props, books, candles, etc. We plan to use environmentally friendly options and source locally when possible.', null, '1', 'Lotus Center Yoga Retail Shop'), ('63', '126', '10', '50', '350', '0000-00-00', '2011-07-03', '2011-04-01 00:00:00', 'Lipstick is upscale salon atmosphere with a bathrobe attitude. We are beauty professionals with secrets to share and we are ready, willing and able to serve all womankind! Our expansion project involves adding an Upstairs Loft Color Lounge overlooking the salon, allowing you to get your color done while you spy on the rest of us! Stop in for a simple cut and style to check us out and see if you want to take things to the next level... Cool with being casual yet ready for serious commitments; our team just can\\\'t wait to help you find the right styles, colors and treatments. Are you getting ready for one of those nights when you really need to \\\"bring it\\\"? Oh yeah, we\\\'ll help you find it and make it all kinds of hot. We do serious work, and have fun doing it. We have enjoyed serving our clients here in the State College area and look forward to growing our business. This deal is flexible -- choose an amount up to $50 and double your money.', '', '1', 'THE \\\'LOFTY GOALS\\\' PROJECT: upstairs loft expansion'), ('64', '127', '10', '20', '400', '0000-00-00', '2011-06-30', '2011-04-04 00:00:00', 'In this town there’s nothing quite like being on College Avenue. Zola plans to bring its dynamic dining experience outside, adding a new patio seating area out front with tables, chairs and big, shady umbrellas. This is a great opportunity to expand one of the area’s cutting-edge dining establishments, the brainchild of two outstanding restaurant entrepreneurs:  Dave Fonash and Paul Kendeffy. Dave, a PSU grad, is also a certified Sommelier (he knows a lot about wine!) and Paul is a graduate of the esteemed Culinary Institute of America. “We think this project is really going to make for a great outside dining experience in downtown State College. We’re really excited about it,” says Paul.   With this deal, you pay $20 and get $40 to use during future visits to Zola.', '', '1', 'THE \\\'Z\\\' ON THE STREET PROJECT: new outdoor seating patio'), ('65', '8', '10', '150', '750', '0000-00-00', '2011-07-01', '2011-04-06 00:00:00', 'PRE-LAUNCH SPECIAL: FIRST 2 SUPPORTERS GET EXTRA $10 - “The glories of spring have revealed the ravages that many long winters have wreaked upon my storefront awning! My modest aim is to launch a successful project that enables me to spruce up the gallery entrance on McAllister Alley Walkway.” With 30 years of experience Douglas Albert has helped many first-time purchasers find new adornments for their homes and assisted many seasoned collectors in making astute acquisitions of fine works. “We pride ourselves in our depth of inventory and standard of quality.”   This deal is flexible: pay up to $150 and get up to $300 to use immediately. Thank you for helping to keep quality art a part of the downtown State College experience.', '', '1', 'THE \\\'THRESHOLD TO A CORNUCOPIA\\\' PROJECT: new gallery entrance awning');
COMMIT;

