01.  Or, drop off at the Cogster booth outside Webster\\\'s.  ATTN:  Redemption period is 15 Months long.', '0'), ('55', '49', '4', 'For those who wish to join for a minimum of $100:  Payment is best by personal check.  Send to:  Cogster, 915 Walnut St., State College, PA 16801.  Or, drop off at the Cogster booth outside Webster\\\'s.  ATTN:  Redemption period is one-day only.', '0'), ('58', '51', '1', '1 Month Free Service Or $20.00 Sheetz Gift Card', '1'), ('59', '52', '5', 'Join for $50.00 (or more) and have your name added to a plaque placed on the wall in the new Pub in honor of your loyal support.  Join for $100.00, and you\\\'ll GET YOUR NAME engraved on the BACK OF A PUB STOOL.  (Limited number; please join today!)', '1'), ('60', '49', '6', 'Under the “8-Week Double Money Option”, you will receive payback in Cogster Cash in the amount of 25% of what you pay, per week, for 8 weeks (200% payback!).  Residents may choose this option for amounts ranging from $10 to $40.  Your cash rewards will begin the day you join our campaign using the secure credit card payment below.  You can access these cash rewards right on your My Account page.  Note:  Each weekly reward is valid for 7 days.  Print your cash and redeem it at Webster’s each week for the next 8 weeks!', '1'), ('61', '49', '7', 'Under the “15-Month Long-Term Supporter Option”, you will receive payback in Cogster Cash in the amount of 10% of what you pay, per month, for 15 months (150% payback!).  Residents may choose this option for amounts ranging from $50 to $500.  Your cash rewards will begin the day your check is received by Cogster.  Once notified, you may access these cash rewards right on your My Account page.  Note:  Each monthly reward is valid for 30 days.  Print your cash and redeem it at Webster’s each month for the next 15 months!  Checks should be made out to “Cogster”, and mailed to 915 Walnut St, State College, PA, 16801.  Include a note with your Cogster username and be sure to specify “Webster’s Campaign Support – 15 Month Option”.', '1'), ('62', '54', '1', 'N/A.', '1'), ('63', '55', '1', 'Just for you; purchase a Cornbag bundle for just $10. No additional shipping. Cornbag bundle includes matching Cornie, Neckaroon and Pockies set.', '1'), ('64', '56', '1', 'By supporting us, you will receive a thank you postcard that includes a picture of one of our animals.', '0'), ('65', '56', '7', 'By supporting us, you will receive a thank you postcard that includes a picture of one of our animals.', '1'), ('66', '57', '8', '', '1'), ('67', '58', '9', '', '1'), ('68', '59', '10', '', '1'), ('69', '60', '10', '', '1'), ('70', '61', '8', '', '1'), ('71', '62', '10', '', '1'), ('72', '63', '11', '', '1'), ('73', '64', '12', '', '1'), ('74', '65', '10', '', '1');
