-- ----------------------------
--  Table structure for `user`
-- ----------------------------
DROP TABLE IF EXISTS `user`;
CREATE TABLE `user` (
  `user_id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `location_id` int(11) NOT NULL,
  `email` varchar(255) NOT NULL,
  `password` varchar(65) NOT NULL,
  `first_name` varchar(50) NOT NULL,
  `last_name` varchar(50) NOT NULL,
  `zip` varchar(9) NOT NULL,
  `female` int(1) DEFAULT '0',
  `birthdate` date DEFAULT NULL,
  `phone` varchar(50) DEFAULT NULL,
  `verified` int(1) NOT NULL DEFAULT '0',
  `active` int(1) NOT NULL DEFAULT '0',
  `date_created` datetime NOT NULL,
  `referring_user_id` int(4) DEFAULT NULL,
  `uid` varchar(30) NOT NULL,
  `cc_id` varchar(20) NOT NULL,
  `user_role` int(10) unsigned NOT NULL DEFAULT '8',
  `registration_code` varchar(10) DEFAULT NULL,
  `notification` varchar(20) DEFAULT '3,2,1',
  `region_id` int(10) unsigned DEFAULT '1',
  `rank_id` smallint(5) NOT NULL DEFAULT '1',
  `points` int(10) unsigned DEFAULT '0',
  `timezone` varchar(100) NOT NULL DEFAULT 'America/New_York',
  PRIMARY KEY (`user_id`)
) ENGINE=InnoDB AUTO_INCREMENT=1435 DEFAULT CHARSET=latin1;

